&lt;魔幻类课程&gt;

&nbsp;

哈利波特系列是一部征服了全世界的伟大著作和电影，它对于好多人来说不仅仅是一个故事，而是象征着我们整个童年。或许我们都曾希望收到霍格沃兹的来信，希望那个充满勇气和梦想的魔法世界真的存在。如今，虽然哈利波特系列已经完结，但留给我们的回忆和感动已经深深印刻在心里。在伦敦郊区有那么一个地方，那里曾经是哈利波特系列电影的发源地，而现在依然是为每个哈迷心中提供着一个梦想寄托的空间。这是伙伴教育专门为青少年设计的一段魔幻文明之旅，不但可以现场感受哈利波特的拍摄场地，还会游走伦敦各个不同的博物馆，观赏感受几千年来的进化与精彩。
<strong>年龄：</strong>12-18 岁
<strong>时长：</strong>2-4周

&nbsp;

<strong>概要</strong>
•哈利波特影视城探访
•畅游日不落帝国的文化足迹，细细品味各大博物馆
•与语言课程结合，与全世界的小伙伴交流旅途的感受

